class Calculadora:
    def __init__(self):
        self.display: float = 0
        self.battery: int = 0
        self.batteryMax: int = 100

    def __str__(self) -> str:
        return f"{self.display}:{self.battery}:{self.batteryMax}"

def main():
    calculadora: Calculadora = Calculadora()
    while True:
        line: str = input()
        print("$"+line)
        args:list[str] = line.split(" ")
        if args[0] == "end":
            break
